import { Steps } from "antd";
import styled from "styled-components";
const { Step } = Steps;


export const CustomStep = styled(Step)`
  .ant-steps-item-process>.ant-steps-item-container>.ant-steps-item-icon {
    background: #9255FD
  }
`
